import React from "react";
import PizzaCard from "./PizzaCard";

const PizzaCardList = ({ allProducts}) => {

  const cardComponent = allProducts.map(({id,...otherCollectionProps}) => {
    return (
      <PizzaCard
      key={id} {...otherCollectionProps}
      />
    );
  });
  return <div className="AllSabores">{cardComponent}</div>;
};

export default PizzaCardList;
